  const {id, name, discountRate} = props;

  return (
    <div>
    <input type="checkbox" />
    <span>{name}</span>
    <span>{discountRate} %</span>
    <button type="button">메뉴 선택</button>
    <DiscountsMenu />
    </div>
  )
}
